INSERT INTO "PUBLIC"."NYHET" (NYHET_ID,NYHET_TXT,AKTIV,TIDLAGTINN,SESONG,LAG_NAVN,OVERSKRIFT) VALUES (26,'Forutsatt at antall p똫eldte lag til 3 divisjon 퓃er i forhold til sesongen 10/11 (Jordal har signalisert at de skal melde p lag), er Rosenhoff forespurt om evt. villighet til  spille i 2 divisjon.<br>Vi har bekreftet villighet overfor Forbundet. Dette er en uforpliktende foresp퓊sel som ogs er avhengig av hvorvidt lag rykker opp fra 2. til 1. divisjon.<br><br>RS',1,{ts '2011-05-13 12:41:56.760000000'},'SESONG_2009','OLDBOYS','Seriespill sesongen 11/12');
