INSERT INTO "PUBLIC"."NYHET" (NYHET_ID,NYHET_TXT,AKTIV,TIDLAGTINN,SESONG,LAG_NAVN,OVERSKRIFT) VALUES (32,'<br>F퓄gende lag er p똫eldt;<br><br>Aker - Forward - Furuset 2 - Gamle Oslo - Jar 2 - Jordal - Prinsdal 2 - Rosenhoff - Skedsmo 2 - Ski 2<br><br>Det spilles dobbelt serie (18 kamper)&nbsp;med oppstart uke 44 ! <br><br>P.S. M퓄la er forel퓈ig ikke p똫eldt !',1,{ts '2011-06-28 14:30:45.427000000'},'SESONG_2009','HOCKEY','Seriep똫elding sesongen 2011-2012');
