INSERT INTO "PUBLIC"."NYHET" (NYHET_ID,NYHET_TXT,AKTIV,TIDLAGTINN,SESONG,LAG_NAVN,OVERSKRIFT) VALUES (34,'Sesongens f퓊ste trening vil, med et lite forbehold,&nbsp;finne sted allerede i uke 36 (begynner med 5 september).<br>Uansett, s er vi ihvertfall p is uka etter. Tidene vil fortl퓈ende legges inn under aktiviteter - hold dere oppdatert. Vel m퓍t til ny sesong !!!!!!!!!!!!!!!!!!<br><br>Rune',1,{ts '2011-08-26 13:30:18.833000000'},'SESONG_2009','HOCKEY','TRENINGER SESONGEN 2011/2012');
