INSERT INTO "PUBLIC"."NYHET" (NYHET_ID,NYHET_TXT,AKTIV,TIDLAGTINN,SESONG,LAG_NAVN,OVERSKRIFT) VALUES (49,'<br>Jonna brakk, i siste seriekamp mot "Lokomotiv Ski", leggbeinet i en umotivert p똩j퓊sel bakfra fra Ski -&nbsp;spiller ; Slobodan Grusovitsj. 칥rige kommentarer er overfl풼ige - spesielt for&nbsp;oss som var tilstede p kampen.<br>Rosenhoff 퓆sker Jonna God bedring&nbsp;og til Slobodan; <STRONG>Ikke spis de sm r풼e pillene med d풼ningehode p esken neste gang du spiller hockeykamp&nbsp;&nbsp;!!!!!</STRONG>&nbsp;',1,{ts '2012-03-15 15:21:22.831000000'},'SESONG_2011','OLDBOYS','Skade i siste seriekamp !');
INSERT INTO "PUBLIC"."NYHET" (NYHET_ID,NYHET_TXT,AKTIV,TIDLAGTINN,SESONG,LAG_NAVN,OVERSKRIFT) VALUES (50,'F퓄gende forslag fra forbundet er ute til h퓊ing:<br>4 divisjon deles inn i 2 puljer - trippel serie - 15 kamper.<br><br><STRONG>Pulje A: </STRONG>Aker - Forward - Nes퓓a - Prinsdal 2 - Skedsmo 3 - Ski 2<br><br><STRONG>Pulje B: </STRONG>B퓄er - Gamle Oslo - Jordal - &nbsp;Kongsvinger 2 - Kr똩ene 2 - Rosenhoff<br><br>RS<br>&nbsp;',1,{ts '2012-06-13 08:15:45.297000000'},'SESONG_2011','HOCKEY','Forslag puljeinndeling 2012/2013');
