INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (1,6,'Vi ble skikkelig pissa p','Ja, hva skal en si. Vi ble vel i bunn og grunn rundspilt fra f퓊ste dropp i sesongens f퓊ste kamp. Skedsmo var rett og slett ett lag som spilte mye puck, og beveget seg. Vi spiller ogs litt puck n똱 vi f퓊st fikk tak i den, men da som regel en meter foran eller bak den vi skal spiller til. Tror vi skal v푨e s 푨lige og si at Skedsmo var ett nummer for store for oss. heldigvis gadd de ikke  spille forsvar, s vi burde lagt inn flere m똪. P den annen side s sto v똱 debuterende keeper Kristoffer meeeeeeeget bra i m똪, og reddet oss fra et st퓊re tap.','SESONG_2009','HOCKEY');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (2,1,'Dette kunne vi ikke tape','I Kr똩ene''s f퓊ste oldboyskamp ever fikk de en flying start. Etter noen minutter sto det 2-1 til Kr똩ene etter at Rosenhoff kl퓆et det til p eksepsjonelt vis i midtsonen. Men etter at vi innhentet ledelsen p en styring mellom egen bl og midsirkelen s var vi aldri truet. Rosenhoff hadde vel pucken 90% av tiden selv om Kr똩ene kom p noen farlige kontringer. Vi seilte inn til en komfortabel seier ihvertfall, og s veldig mye mer  si om den kampen er det vel ikke.','SESONG_2009','OLDBOYS');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (3,11,'Kritikkverdig forsvarsspill !!','Resultatet i denne kampen gir et litt feil bilde av matchen. Jordal var utvilsomt bedre enn oss men ikke s mye bedre som resultatet skulle tilsi. Vi har imidlertid  mye  jobbe med p defensiven b똡e i overganger og i etablert forsvar. \nM똪 i mot, i etablert forsvar, kommer alltid som et resultat av manglende struktur. I tillegg opererer vi med et s stort strekk i laget, i overganger i mot, at et par individuelt dyktige Jordal spillere f똱 lett spill.\nVi var i tillegg bare 9 utespillere hvorav 2 b둩ker. At resten da ikke aner at det er kamp, prioriterer  dra p hytta eller hva f... de driver med , taler vel egentlig for seg selv. Stor hon퓊 imidlertid, til gutta som m퓍te opp.','SESONG_2009','HOCKEY');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (4,3,'Stort sett kontroll','F퓄er vel at vi kontrollerte denne kampen. Skedsmo var farlige p overganger, men vi greide stort sett  styre angrepene ut i rundvant. Vi hadde et utall sjanser ift.  score, men la pucken stort sett rett p keeper. En god kamp for퓏rig av keeper Trond Ofte.','SESONG_2009','OLDBOYS');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (5,9,'Temposvakt','I en temposvak kamp mot et Progress som var farlige p kontringer og hadde et par individuelt bra spillere, hadde vi imidlertid mange muligheter til  "drepe" denne kampen p et tidlig tidspunkt. Keepern til Progress spilte en god kamp men vi sliter fortsatt med for d똱lige avslutninger. Sesongens d똱ligste kamp hittil - men vi vinner tross alt, p en d똱lig dag.','SESONG_2009','OLDBOYS');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (6,13,'Lett Match','En enkel kamp mot L퓊enskog som bare stilte med 6 utespillere. L퓊enskog hang delvis med i 1 periode og ledet innlednigsvis 1-0. I siste periode kj퓊te vi over en sliten motstander med 11 - 1, og hadde til tider bra spill og fine kombinasjoner. B똡e Humba og Svein brukte denne kampen til  trene slagskudd uten  havne i utvisningsboksen. Forventer at dette vil gi seg utslag i bedre skuddkvalitet p neste A-lags kamp.','SESONG_2009','OLDBOYS');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (7,14,'HISTORISKE SIFRE','Om det noen gang har skjedd i Rosenhoffs historie overhode, s m det i s똣all v푨e veldig lenge siden at vi har scora 22 m똪 i en seriekamp. Det er vel ikke s푨lig mer  si enn at vi kj퓊te over Furuset 2 i denne kampen - spesielt i 2 periode som vi vant 12-1. Mye bra spill og mange fine m똪 mot et lag som ikke kunne p똟erope seg  ha 4 divisjons beste defensive organisering. Men Furuset ga aldri opp, og greide  til tider  etablere et bra offensivt spill. Unge Kjus var skikkelig i drivet i denne kampen og noterte seg for 9 scoringer. "Humba" ville umiddelbart etter  ha lest matchprotokollen,vurdere  s퓃e juridisk bistand i den hensikt  saks퓃e protokollf퓊erne som han mener har snytt ham for 1 scoring og 2 pasninger.','SESONG_2009','HOCKEY');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (8,17,'Str똪ende prestasjon !','Med 8 utespillere kjempet Rosenhoff seg til en fortjent 5-3 seier over tabell eneren Ski 2. Etter en sjokk똯ning hvor Ski ledet 2-0 etter 26 sekunder jobbet vi oss inn i kampen med en innsats av en annen verden. Selv om samtlige ble dyktig slitne etterhevert, ble det gitt jernet av samtlige i 3X15 minutter. Spesielt for Kristoffer, Marius og Ola, som alle har spilt juniorhockey i Ski, var det helt uaktuelt  tape denne kampen. Dette var en lagseier av dimensjoner !\nF퓄gende spilte; Kristoffer - Ola - Marius - Anders - Andreas K - Svein - Tuomas - Rune O - Tore !!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!','SESONG_2009','HOCKEY');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (9,18,'Sr똪ende prestasjon !','Med 8 utespillere kjempet Rosenhoff seg til en fortjent 5-3 seier over tabell eneren Ski 2. Etter en sjokk똯ning hvor Ski ledet 2-0 etter 26 sekunder jobbet vi oss inn i kampen med en innsats av en annen verden. Selv om samtlige ble dyktig slitne etterhevert, ble det gitt jernet av samtlige i 3X15 minutter. Spesielt for Kristoffer, Marius og Ola, som alle har spilt juniorhockey i Ski, var det helt uaktuelt  tape denne kampen. Dette var en lagseier av dimensjoner !\nF퓄gende spilte; Kristoffer - Ola - Marius - Anders - Andreas K - Svein - Tuomas - Rune O - Tore !!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!','SESONG_2009','HOCKEY');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (10,27,'Bra forsvarskamp !','Et godkjent forsvarsspill og en str甄lende keeper gjorde sitt til at vi vant denne kampen. Prinsdal eide puck i store deler av kampen og vant skuddstastistikken overlegent. Vi spilte fornuftig i forsvar - holdt stort sett sonene v甄re og kontret inn 4 m甄l.  Matchens beste spiller var utvilsomt keeper Kristoffer som s甄  langt leverer sesongens beste kamp.','SESONG_2009','HOCKEY');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (11,30,'Bra Lagmoral !','Etter 甄 ha ligget under med ett m甄l etter 2. periode - kommer vi sterkt tilbake og vinner siste periode med 5 - 2. Mange av m甄lene (b甄de for og i mot) kommer i overtall/undertall. Kjus og Tuomas er d戒delig effektive i overtall, men greier samtidig 甄 slippe inn 2 m甄l p甄 66 sekunder hvilket skaper nesten balanse i m甄lstatistikke p甄 tampen av 3. periode. Olsen putter imidlertid n甄r det gjenst甄r 1:44 etter en millimetern戒yaktig pasning fra Humba i fint driv.\nGanske jevnspilt kamp - bra forsvarsspill og god lagmoral sikrer seier i denne kampen.','SESONG_2009','HOCKEY');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (12,35,'Nesten seier !','Nok en kamp hvor vi "sover" i deler av 1. periode og ligger under 3-0 etter 10 minutter. Henter oss bra inn og avslutter 1. periode med 2-3 i m甄lprotokollen. En str甄lende 2.periode som vi vinner 3-1 gjorde at vi hadde forh甄pninger om seier over Jordal som hadde "knust" oss i den f戒rste kampen. Spesielt 3 m甄let var en perle etter en str甄lende pasninger fra Tuomas som Kjuser`n setter n甄del戒st i kassa. Siste periode topper "trener Illsint" Jordal - og bare en heroisk defensiv innsats hindrer oss i 甄 tape denne kampen. En etterhvert meget god defensiv innsats og en str甄lende god Kristoffer spesielt i 2 og 3 periode gjorde at vi gikk uavgjort ut av denne kampen. 3 m甄l av Kjuser`n og 2 av "Iskalde" Rudihaugen. Skuddstatistikk: 46-23 fordel Jordal.','SESONG_2009','HOCKEY');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (13,36,'Komfortabel seier !','En ikke alt for god kamp mot et Mosselag som til enhver tid har turboen kobla inn. Vi fikk ikke spillet til 甄 gli p甄 en litt d甄rlig isflate som var b甄de myk og ruglete. Kr甄kene kom p甄 enkelte kontringer, men var ikke den helt store trusselen ift. 甄 p甄virke utfallet av kampen. Den st戒rste defensive trusselen i denne matchen var Gulbrandsen som etter et utall piruetter i egen sone, ga fra seg pucken til en Mossing som enkelt satt pucken bak Rosenhoffs keper. Enkelte fine spillem甄l, men ingen stor match spillemessig, hvilket Eddy beskjedent ga klart uttrykk for ved et par anledninger ila kampen ! ','SESONG_2009','OLDBOYS');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (14,34,'Storseier !','En ukomplsert seier hvor Oilers ble avsl?女rt p?若 manglende tempo. Det hjalp ikke i denne kampen ?若 ha tre-sifra antall landskamper s?若 lenge ikke spillet fungerer og tempoet er frav??rende. "Putte" herjer med "Kokken" og setter 5 h?若ndleddsskudd inn bak Oilers s?若 ellers meget gode sisteskanse.Alle opp p?若 snapphanske - siden.  Rosenhoffs keper ble knapt nok svett i hyssingen etter denne matchen.','SESONG_2009','OLDBOYS');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (15,21,'M甄lforvirring','Vi 甄pner denne kampen bra, men slipper Gamle Oslo inn i kampen som ender 7-7 - tror vi. Helt til dommeren, som f戒rer m甄loversikten med kulepenn ,p甄 knokene p甄 venstreh甄nda, finner ut at resultatet er 8-7 til Gamle Oslo. Det hjelper lite med protester - selv Gamle Oslo sine spillere lar seg etterhvert overbevise av dommerens venstreh甄nd - hvor strekene mildt sagt minner mer om et kart over  lite beferdede turstier i Oslomarka. Av hensyn til 甄 unng甄 甄 f甄 en injuriesak p甄 nakken, velger man ikke 甄 kommentere denne hendelsen ytterligere. Imponerende !!!!!!!','SESONG_2009','OLDBOYS');
INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (16,38,'Bra start - elendig avslutning !','Etter en meget bra start p甄 kampen hvor vi leder 4-0 etter 12 minutter og 6-1 etter 3 min 15 ut i annen periode, sovner vi fullstendig og Aker overtar mer og mer av spillet. En, i likhet med 戒vrige spillere, bra innledning av Ola som lager 3 m甄l ila 1 periode . H甄per vi tar inn over oss at en kamp ikke er vunnet etter 11/2 periode. En kombinasjon av dette og at muligens kondis og krefter svikter, gj戒r at denne kampen endte uavgjort 6-6. Ganske utrolig !','SESONG_2009','HOCKEY');
