INSERT INTO "PUBLIC"."RAPPORT" (ID,KAMP,OVERSKRIFT,TEKST,SESONG,LAG_NAVN) VALUES (18,65,'Lagseier','Med unntak av f퓊ste halvdel av 2. periode var vi helt p h퓓de og tidvis bedre enn H/L. Den store forskjellen bestod i at vi utnyttet sjansene v똱e bedre enn motstanderlaget. Kristoffer leverer en solid kamp i m똪 og vi opptrer som en lagenhet uten veldig mye avstand mellom l퓈ere og backer. En stor honn퓊 til Knut "Kula" som ikke har spilt back siden Boer krigen og viser defensive fibre langt utover forventet.','SESONG_2011','HOCKEY');
